import 'bootstrap/dist/css/bootstrap.css';
import './Landing.css';
 
const Home = () => {

    const containerStyle = {
        maxWidth: '50vh', /*'375px'*/
        maxHeight: '100vh',
        margin: '0 auto', /* Center the content horizontally */
        backgroundColor: '#f7f3f0', /* Optional: Set a background color */
      };
    
    return (
        <div style={containerStyle}>
            <h1>Welcome</h1>
    


        </div>

)};
 
